import { useState } from 'react';
import './App.css';

function App() {
    const [userInput, setInput] = useState('');
    const checkInput = () => {
        setInput('');
    };

    return (
        <div className='App'>
            Please input a 5 letter word:
            <input
                className='word-input'
                type='text'
                onChange={(e) => {
                    setInput(e.target.value);
                }}
                value={userInput}
            ></input>
            <button className='input-btn' onClick={checkInput}></button>
        </div>
    );
}

export default App;
